import{_ as e,c as r,o as a,a as t}from"./app.2e840582.js";const f=JSON.parse('{"title":"Credits","description":"","frontmatter":{},"headers":[{"level":2,"title":"Design & Development","slug":"design-development","link":"#design-development","children":[]},{"level":2,"title":"Supporting Research Projects","slug":"supporting-research-projects","link":"#supporting-research-projects","children":[]},{"level":2,"title":"Artistic & Research  Collaborations","slug":"artistic-research-collaborations","link":"#artistic-research-collaborations","children":[]},{"level":2,"title":"Citing this Work","slug":"citing-this-work","link":"#citing-this-work","children":[]},{"level":2,"title":"Related Academic Papers","slug":"related-academic-papers","link":"#related-academic-papers","children":[]},{"level":2,"title":"License","slug":"license","link":"#license","children":[]}],"relativePath":"credits.md"}'),i={name:"credits.md"},n=t('<h1 id="credits" tabindex="-1">Credits <a class="header-anchor" href="#credits" aria-hidden="true">#</a></h1><h2 id="design-development" tabindex="-1">Design &amp; Development <a class="header-anchor" href="#design-development" aria-hidden="true">#</a></h2><p><code>soundworks</code> has been initiated by <a href="https://github.com/NorbertSchnell" target="_blank" rel="noreferrer">Norbert Schnell</a>, <a href="https://github.com/i-Robi" target="_blank" rel="noreferrer">S\xE9bastien Robaszkiewicz</a>, and <a href="https://github.com/b-ma" target="_blank" rel="noreferrer">Benjamin Matuszewski</a> at the <a href="http://ismm.ircam.fr/" target="_blank" rel="noreferrer">ISMM</a> team at <a href="http://www.ircam.fr/" target="_blank" rel="noreferrer">Ircam - Centre Pompidou</a> in the context of the <a href="http://cosima.ircam.fr/" target="_blank" rel="noreferrer">CoSiMa</a> research project founded by the French National Research Agency (ANR).</p><p>Development is now led by Benjamin Matuszewski, in the <a href="https://www.stms-lab.fr/team/interaction-son-musique-mouvement/" target="_blank" rel="noreferrer">Sound Music Movement Interaction Team</a> from the Ircam&#39;s STMS-LAB.</p><h2 id="supporting-research-projects" tabindex="-1">Supporting Research Projects <a class="header-anchor" href="#supporting-research-projects" aria-hidden="true">#</a></h2><p>Initial and futher developments has been supported by the following research projects:</p><ul><li>The <a href="http://dots.ircam.fr/" target="_blank" rel="noreferrer">DOTS</a> project, funded by the French National Research Agency (ANR)</li><li>The Ircam projects <em>BeCoMe</em> and <em>SO(a)P</em></li><li>The <em>Constella(c)tions</em> residency, funded by the STARTS program of the European Commission</li><li>The <a href="http://rapidmix.goldsmithsdigital.com/" target="_blank" rel="noreferrer">RAPID-MIX project</a>, funded by the European Union\u2019s Horizon 2020 research and innovation program</li><li>The <a href="http://cosima.ircam.fr/" target="_blank" rel="noreferrer">CoSiMa</a> project, funded by the French National Research Agency (ANR)</li></ul><h2 id="artistic-research-collaborations" tabindex="-1">Artistic &amp; Research Collaborations <a class="header-anchor" href="#artistic-research-collaborations" aria-hidden="true">#</a></h2><p>The design &amp; development of <code>soundworks</code> has also been conducted within many collaborations with composers, artists, designers and researchers.</p><p>A number of musical pieces and artworks created using <code>soundworks</code> can be found on the Ircam - Sound Music Movement Interaction team youtube channel <a href="https://www.youtube.com/ircam-ismm" target="_blank" rel="noreferrer">https://www.youtube.com/ircam-ismm</a>.</p><p>Some generic applications are also accessible online at <a href="https://apps.ismm.ircam.fr" target="_blank" rel="noreferrer">https://apps.ismm.ircam.fr</a>.</p><h2 id="citing-this-work" tabindex="-1">Citing this Work <a class="header-anchor" href="#citing-this-work" aria-hidden="true">#</a></h2><ul><li>Benjamin Matuszewski. A Web-Based Framework for Distributed Music System Research and Creation. AES - Journal of the Audio Engineering Society Audio-Accoustics-Application, Audio Engineering Society Inc, 2020. &lt;<a href="https://hal.archives-ouvertes.fr/hal-03033143" target="_blank" rel="noreferrer">hal-03033143</a>&gt;</li></ul><h2 id="related-academic-papers" tabindex="-1">Related Academic Papers <a class="header-anchor" href="#related-academic-papers" aria-hidden="true">#</a></h2><ul><li>Frederic Bevilacqua, Benjamin Matuszewski, Garth Paine, Norbert Schnell. On Designing, Composing and Performing Networked Collective Interactions. Organised Sound, Cambridge University Press (CUP), 2021, 26 (3), pp.333-339. &lt;<a href="https://hal.archives-ouvertes.fr/hal-03575509" target="_blank" rel="noreferrer">hal-03575509</a>&gt;</li><li>Benjamin Matuszewski. A Web-Based Framework for Distributed Music System Research and Creation. AES - Journal of the Audio Engineering Society Audio-Accoustics-Application, Audio Engineering Society Inc, 2020. &lt;<a href="https://hal.archives-ouvertes.fr/hal-03033143" target="_blank" rel="noreferrer">hal-03033143</a>&gt;</li><li>Benjamin Matuszewski. Soundworks - A Framework for Networked Music Systems on the Web - State of Affairs and New Developments. Proceedings of the Web Audio Conference (WAC) 2019, Dec 2019, Trondheim, Norway. &lt;<a href="https://hal.archives-ouvertes.fr/hal-02387783" target="_blank" rel="noreferrer">hal-02387783</a>&gt;</li><li>Benjamin Matuszewski, Norbert Schnell, Fr\xE9d\xE9ric Bevilacqua. Interaction Topologies in Mobile-Based Situated Networked Music Systems. Wireless Communications and Mobile Computing, Hindawi Publishing Corporation, 2019. &lt;<a href="https://hal.archives-ouvertes.fr/hal-02086673" target="_blank" rel="noreferrer">hal-02086673</a>&gt;</li><li>Jean-Philippe Lambert, S\xE9bastien Robaszkiewicz, Norbert Schnell. Synchronisation for Distributed Audio Rendering over Heterogeneous Devices, in HTML5. 2nd Web Audio Conference, Apr 2016, Atlanta, GA, United States. &lt;<a href="https://hal.archives-ouvertes.fr/hal-01304889v1" target="_blank" rel="noreferrer">hal-01304889</a>&gt;</li><li>Norbert Schnell, S\xE9bastien Robaszkiewicz. Soundworks \u2013 A playground for artists and developers to create collaborative mobile web performances. Proceedings of the Web Audio Conference (WAC&#39;15), 2015, Paris, France. &lt;<a href="https://hal.archives-ouvertes.fr/hal-01580797" target="_blank" rel="noreferrer">hal-01580797</a>&gt;</li></ul><h2 id="license" tabindex="-1">License <a class="header-anchor" href="#license" aria-hidden="true">#</a></h2><p><a href="https://github.com/collective-soundworks/soundworks/blob/master/LICENSE" target="_blank" rel="noreferrer">BSD-3-Clause</a></p>',17),o=[n];function s(l,c,h,d,p,m){return a(),r("div",null,o)}const g=e(i,[["render",s]]);export{f as __pageData,g as default};
